  author: "jimdaly"
  ms.author: "jdaly"
  manager: "jdaly"
  meta-description: "Reference information about the Dynamics 365 Customer Engagement msdyn_dataexport entitytype."
description: "Data export entity for the actual entity."
header:
  entity_set_path: "[organization URI]/api/data/v9.0/msdyn_dataexports"
  base_type: Microsoft.Dynamics.CRM.crmbaseentity
  display_name: Actual Data Export (Deprecated)
  primary_key: msdyn_dataexportid
  primary_name_attribute: msdyn_name
  operations_supported:
  - POST
  - GET
  - PATCH
  - DELETE
namespace: Microsoft.Dynamics.CRM
properties:
  description: "Properties represent fields of data stored in the entity.Some properties are read-only."
  property_items:
    - name: createdon
      type: Edm.DateTimeOffset
      display_name: "Created On"
      description: "Date and time when the record was created."
      iscomputed: false
      isreadonly: true
    - name: importsequencenumber
      type: Edm.Int32
      display_name: "Import Sequence Number"
      description: "Sequence number of the import that created this record."
      iscomputed: false
      isreadonly: false
    - name: modifiedon
      type: Edm.DateTimeOffset
      display_name: "Modified On"
      description: "Date and time when the record was modified."
      iscomputed: false
      isreadonly: true
    - name: msdyn_dataexportid
      type: Edm.Guid
      display_name: "Actual Data Export"
      description: "Shows the entity instances."
      iscomputed: false
      isreadonly: false
    - name: msdyn_datatoken
      type: Edm.String
      display_name: "Data Token"
      description: "The data token that is returned on a successful export. The data token is used to retrieve only the newly added records."
      iscomputed: false
      isreadonly: false
    - name: msdyn_entityname
      type: Edm.String
      display_name: "Entity Name"
      description: "Name of the entity exported"
      iscomputed: false
      isreadonly: false
    - name: msdyn_exportedrecordcount
      type: Edm.Int32
      display_name: "Exported Record Count"
      description: "The number of records that have been currently exported"
      iscomputed: false
      isreadonly: false
    - name: msdyn_exportstatus
      type: Edm.Int32
      display_name: "Export Status"
      description: "Status of the export"
      iscomputed: false
      isreadonly: false
      options:
        - value: 192350000
          label: "Submitted."
        - value: 192350001
          label: "Exporting."
        - value: 192350002
          label: "Completed. All records extracted."
        - value: 192350003
          label: "Exported with more records to extract."
    - name: msdyn_linkedentitydata
      type: Edm.String
      display_name: "Linked Entity Data"
      description: "Contains data representing the linked entities"
      iscomputed: false
      isreadonly: false
    - name: msdyn_name
      type: Edm.String
      display_name: "Name"
      description: "Type the name of the record."
      iscomputed: false
      isreadonly: false
    - name: msdyn_pagingdata
      type: Edm.String
      display_name: "Paging Data"
      description: "Paging data associated to an incomplete export."
      iscomputed: false
      isreadonly: false
    - name: overriddencreatedon
      type: Edm.DateTimeOffset
      display_name: "Record Created On"
      description: "Date and time that the record was migrated."
      iscomputed: false
      isreadonly: false
    - name: statecode
      type: Edm.Int32
      display_name: "Status"
      description: "Status of the Actual Data Export"
      iscomputed: false
      isreadonly: false
      options:
        - value: 0
          label: "Active"
        - value: 1
          label: "Inactive"
    - name: statuscode
      type: Edm.Int32
      display_name: "Status Reason"
      description: "Reason for the status of the Actual Data Export"
      iscomputed: false
      isreadonly: false
      options:
        - value: 1
          label: "Active"
        - value: 2
          label: "Inactive"
    - name: timezoneruleversionnumber
      type: Edm.Int32
      display_name: "Time Zone Rule Version Number"
      description: "For internal use only."
      iscomputed: false
      isreadonly: false
    - name: utcconversiontimezonecode
      type: Edm.Int32
      display_name: "UTC Conversion Time Zone Code"
      description: "Time zone code that was in use when the record was created."
      iscomputed: false
      isreadonly: false
    - name: versionnumber
      type: Edm.Int64
      display_name: "Version Number"
      description: "Version Number"
      iscomputed: false
      isreadonly: true
